import './App.css';
import './components/rmnquotes';
function App() {
    let quote = 'lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum lorem ipsum ';
    let author = 'Yo jimbo';
  return (   
    <div>
        <div className='container quote-box'>
            <p>
                "{quote}"
            </p>
            <p>
                - {author}
            </p>
        </div>
    </div>
  );
}

export default App;
